import React from "react";
import Header from "./components/Header"


const Home = () => {

    const [flavors, setFlavors] = React.useState([]);

    React.useEffect( () => {
        fetchData();
    }, []);


    const fetchData = async () => {
        const response = await fetch("/");
        const items = await response.json();

        setFlavors(items);
    };

    return (
        <Header />
    );
}

export default Home;
